window.bookSummaryJSON = "<p>Finding out you’re the daughter of a famous serial killer isn’t all it’s cracked up to be.</p> <p>My father—the Seattle Slayer—is charismatic, intelligent, and charming.</p> <p>He’s also trying to teach me to kill people, so…his good qualities don’t seem to matter much.</p> <p>He’s kidnapped my boyfriend, a guy that I used to hate but grew to love.</p> <p>Parrish, I’m coming for you. I’ll do anything—anything—to keep you safe.</p> <p>Starting a new life as the most hated girl in Whitehall Prep was not in my gameplan.</p> <p>But when I asked my dad what the point of all this was, you know what he said?“It’s payback, Princess.”The upper crust families in Medina have wrongs to answer for, wrongs that will be paid in blood—by me.</p> <p>Justin Prior is back in town, and he's brimming with secrets.</p> <p>The question is: how far will I go to uncover them?</p> <p>Parrish is bruised and bleeding; Chasm burns with violent heat; Maxx is a thundercloud waiting in the wings. Lumen lies. Danyella knows. Kimber fights back.</p> <p>Welcome to Medina, b*tches. Love-hate is in the air, and it isn't just me that feels it. This town is cursed in blood and diamonds.</p> <p>I’ll win this thing, Dad.</p> <p>Do your worst.</p> <p><i>Payback Princess</i> is a 211,000 word love-hate/high school romance with suspense/thriller themes. Includes foul language and sexual scenes; any sex featured is consensual. This is a reverse harem novel, meaning the main character has more than one love interest. This is Book Two of four in the series. This series is complete.</p>"; 
